import { useEffect, useState } from "react";


function Details(){
    const [details,setDetails]=useState()
    
    useEffect(()=>{
        fetch("http://localhost:3009/seconddata/:empid")
        .then((res) => {
            return res.json()
        })
        .then((resp) => {
            setDetails(resp)
            console.log(resp)
        })
    },[])

    return(
        <div>
           {details.map=((ourdata)=>(
             <p>{ourdata.id}</p>,
             <p>{ourdata.name}</p>


           ))}
        </div>
    )
}
export default Details;
